import React from 'react';

function Card({ id, link, name, likes }) {
  return (
    <template id='element-template' key={id}>
      <article class='element'>
        <div class='element__image-container'>
          <img class='element__image' src={link} alt={name} />
        </div>
        <button type='button' class='element__delete-btn'></button>
        <div class='element__wrapper'>
          <h2 class='element__place-name'>{name}</h2>
          <div class='element__like-container'>
            <button type='button' class='element__like-btn button'></button>
            <p class='element__likes-number'>{likes}</p>
          </div>
        </div>
      </article>
    </template>
  );
}

export default Card;
